import React from "react";
import s from './MyPosts.module.css'
import classes from "../Profile.module.css";

const MyPosts = () =>{
    return(
    <div>
        <div>
            <textarea name="" id="" cols="30" rows="10"></textarea>
            <button>Add post</button>
            <button>Delete post</button>
        </div>
        <div className={classes.posts}>
            <div className={classes.item}>
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ficon-icons.com%2Fru%2F%25D0%25B7%25D0%25BD%25D0%25B0%25D1%2587%25D0%25BE%25D0%25BA%2F%25D0%25B0%25D0%25B2%25D0%25B0%25D1%2582%25D0%25B0%25D1%2580-%25D0%25B6%25D0%25B5%25D0%25BD%25D1%2589%25D0%25B8%25D0%25BD%25D0%25B0-%25D0%25BF%25D0%25BE%25D1%2580%25D1%2582%25D1%2580%25D0%25B5%25D1%2582%2F113261&psig=AOvVaw1ogSiN2NPNccEm6O0LrAhT&ust=1599146509902000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCIir8pHjyusCFQAAAAAdAAAAABAD" alt=""/>
                post1
            </div>
            <div className={classes.item}>
                post2
            </div>
        </div>
    </div>
    );
}
export default MyPosts;
